import ReviewCard from "../js/ReviewCard";

function Reviews() {
  return (
    <div style={{ paddingTop: "15px", textAlign: "center", height: "90vh" }}>
      <h1>Reviews</h1>
      <hr style={{ width: "90%" }}></hr>
      <ReviewCard />
    </div>
  );
}

export default Reviews;
